
import "dotenv/config";
import fs from "fs";
import qs from "qs"
import axios from "axios";
import https from "https";

const consumerKey = process.env.CONSUMER_KEY;
const consumerSecret = process.env.COMSUMER_SECRET;
const CNPJ_contratante = process.env.CNPJ_CONTRATANTE;


function getHttpsAgent() {
  const certificadoP12 = 'utils/cert/cert.pfx'; // Defina o caminho aqui
  const senhaCertificado = process.env.SENHA_CERTIFICADO; // Defina a senha aqui

  return new https.Agent({
    pfx: fs.readFileSync(certificadoP12),
    passphrase: senhaCertificado
  });
}

async function obterTokens() {
  const tokenUrl = 'https://autenticacao.sapi.serpro.gov.br/authenticate';
  const auth = Buffer.from(`${consumerKey}:${consumerSecret}`).toString('base64');
  const headers = {
    'Authorization': `Basic ${auth}`,
    'role-type': 'TERCEIROS',
    'Content-Type': 'application/x-www-form-urlencoded'
  };
  const data = qs.stringify({ grant_type: 'client_credentials' });
  
  /*const httpsAgent = new https.Agent({
    pfx: fs.readFileSync(certificadoP12),
    passphrase: senhaCertificado
  });*/

  const httpsAgent = getHttpsAgent();

  try {
    const response = await axios.post(tokenUrl, data, {
    headers,
    httpsAgent
  });

  //console.log('Token de acesso:', response.data);

  return {
    accessToken: response.data.access_token,
    jwtToken: response.data.jwt_token
  };
  } catch (error) {
    console.error('Erro ao obter o token:', error.response.data);
    throw new Error('N√£o foi poss√≠vel obter o token de acesso');
  }
}

